import React from 'react';
import {Launch} from '../Launch';
import Axios from 'axios';
import "./styles.scss";

export class Launches extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            launches: [],
            callBack: props.callBack
        }
    }
    componentDidMount = () => {
        console.log("mounted");
        const queryString = ("start=" + this.props.start + "&end=" + this.props.end);
        console.log(queryString);
        Axios.get('https://api.spacexdata.com/v3/launches/past?' + queryString)
        .then((response) => {
            this.setState({
                launches: response.data.map((launch, index) => {
                    return <Launch key = {"Launch" + index} img={launch.links.mission_patch} title={launch.mission_name} date={launch.launch_date_utc} desc={launch.details} payload=""/*{launch.rocket.secondstage.payloads}*/ />;
                })
            });
            console.log(this.state.launches);
        });
    }
    componentDidUpdate = () => {
        console.log(this.props);

    }
    componentWillUpdate
    componentWillUnmount = () => {
        console.log("unmounted");
    }
    render = () => {
        const launchesMap = this.state.launches.map((launchData) => {//map through array of launches and display info
            return <Launch img="" title="" date="" desc="" payload=""/>;
        });
        return (
            <div className="launches">
                {launchesMap}
            </div>
        );
    }
}
